int test_count = sizeof(test_cases) / sizeof(test_cases[0]);

#define MAX_STRING_DISPLAY_LEN 28

int main() {
	char output[33];
	int  pass_count = 0;

	for (int i = 0; i < test_count; i++) {
		int len = (int)strlen(test_cases[i].string);
		md5_hexdigest(test_cases[i].string, output);

		if (len > MAX_STRING_DISPLAY_LEN) {
			printf("String: %.*s..., len: %d\n", MAX_STRING_DISPLAY_LEN,
			       test_cases[i].string, len);
		} else {
			printf("String: %s, len: %d\n", test_cases[i].string, len);
		}

		if (memcmp(output, test_cases[i].hash, 33) == 0) pass_count++;
		else {
			printf(", len: %d\n", len);
			printf("  digest: %s\n", output);
			printf("expected: %s\n", test_cases[i].hash);
			printf("Test #%d failed\n", i + 1);
		}
	}

	if (pass_count == test_count) printf("\nAll %d tests passed!\n", test_count);
	else printf("\n%d/%d tests passed\n", pass_count, test_count);

	return 0;
}
